import { Component } from '@angular/core';

// Definición de la interfaz fuera de la clase del componente
interface Rescatado {
  nombre: string;
  apellido: string;
  edad: string;
  sexo: string;
  procedencia: string;
  valoracion_medica: string;
  medico_id: string;
  rescate_id: string;
}

@Component({
  selector: 'app-form-rescatados',
  templateUrl: './form-rescatados.component.html',
  styleUrls: ['./form-rescatados.component.scss']
})
export class FormRescatadosComponent {
  // Propiedades del formulario
  nombre = '';
  apellido = '';
  edad = '';
  sexo = '';
  procedencia = '';
  valoracion_medica = '';
  medico_id = '';
  rescate_id = '';

  // Lista de rescatados
  rescatados: Rescatado[] = [];

  constructor() {
    // Inicialización de la lista de rescatados
    this.rescatados = [
      { nombre: "Juan", apellido: "Perez", edad: "30", sexo: "M", procedencia: "Madrid", valoracion_medica: "Buena", medico_id: "1", rescate_id: "101" },
      { nombre: "Maria", apellido: "Gomez", edad: "25", sexo: "F", procedencia: "Barcelona", valoracion_medica: "Regular", medico_id: "2", rescate_id: "102" },
      { nombre: "Luis", apellido: "Lopez", edad: "40", sexo: "M", procedencia: "Valencia", valoracion_medica: "Mala", medico_id: "3", rescate_id: "103" },
      { nombre: "Ana", apellido: "Martinez", edad: "35", sexo: "F", procedencia: "Sevilla", valoracion_medica: "Buena", medico_id: "4", rescate_id: "104" },
      { nombre: "Carlos", apellido: "Garcia", edad: "28", sexo: "M", procedencia: "Bilbao", valoracion_medica: "Regular", medico_id: "5", rescate_id: "105" }
    ];
  }
}
